import "./register_body.css";
import React from "react";
import { Link } from "react-router-dom";

class RegisterBody extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (

        <div class="home_register_wrapper">
            <h2 className="home_register_title">Sign up for a free account</h2>
            <form className="home_register_form" action="#">
              <div class="home_register_input_box">
                <input className="home_register_input" type="text" placeholder="first name" required/>
              </div>
              <div class="home_register-input-box">
                <input className="register-input" type="text" placeholder="last name" required/>
              </div>
              <div class="register-input-box">
                <input className="register-input" type="password" placeholder="email" required/>
              </div>
              <div class="register-input-box">
                <input className="register-input" type="password" placeholder="password" required/>
              </div>
              {/* <div class="register-policy">
                <input className="register-input" type="checkbox"/>
                <h3 className="register-header">I accept all terms & condition</h3>
              </div> */}
              <div class="register-input-box register-button">
                <input className="register-input " id="register-input-button" type="Submit" value="Register Now"/>
              </div>
              <div class="register-text">
                <h3 className="register-header">Already have an account?
                    <Link to="/login" class="register-link">
                    Login now
                    </Link>


               </h3> 



              </div>
            </form>
          </div>
        );
    }
}

export default RegisterBody;
